pragma solidity >=0.6.0 <0.9.0;

contract SimpleStorage {

    uint public favNum; // initializedd to 0
    bool favBool;
    string favString;
    int favInt;
    address favAddr = 0xFf9E843a68B78251907dCBA616f09b03012B545f;
    bytes favBytes;

    struct People {
        uint favNum;

    }

    function storeNum(uint numberIn) public {
        favNum = numberIn;
    }

    function retrieve() public view returns(uint) {
        return favNum;
    }

    function calRet() public view returns(uint) {
        return cal(favNum);
    }

    function cal(uint fav) internal pure returns(uint) {
        uint res = fav + 1;
        return res;
    }
}

